import React from 'react'
import { Link } from 'react-router-dom'

const Won = () => {
    return (
        <div>
            <h1>Won</h1>
            <h1><Link to="/Categ"  style={{textDecoration:"none", color:"white"}} >Try Again</Link></h1>
            <h1> <Link to="/">Go Home</Link></h1>
        </div>
    )
}

export default Won
